// SPDX-License-Identifier: MIT

pragma solidity >=0.6.0 <0.9.0;
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract MainRouter is Ownable {
    //    using SafeMathChainlink for uint256;

    mapping(address => uint256) public stakersToAmout;
    mapping(address => uint256) public uniqueTokensStaked;
    address[] public stakers;
    mapping(address => uint256) public answersToAmout;
    address[] public answers;
    IERC20 public OTToken;

    //   address public owner;
    address[] public allowedTokens;

    constructor(address _ourTokenAddress) public {
        OTToken = IERC20(_ourTokenAddress);
    }

    function stake(uint256 _amount, address _token) public payable {
        uint256 minStake = 10000000000000000;
        require(tokenIsAllowed(_token), "Token is not allowed");
        require(_amount >= minStake, "You need to spend more token!");
        IERC20(_token).transferFrom(msg.sender, address(this), _amount);
        updateUniqueTokensStaked(msg.sender, _token);
        stakersToAmout[msg.sender] += _amount;
        if (uniqueTokensStaked[msg.sender] == 1) {
            stakers.push(msg.sender);
        }
    }

    function updateUniqueTokensStaked(address _user, address _token) internal {
        if (stakersToAmout[_user] <= 0) {
            uniqueTokensStaked[_user] = uniqueTokensStaked[_user] + 1;
        }
    }

    function tokenIsAllowed(address _token) public returns (bool) {
        for (
            uint256 allowedTokensIndex = 0;
            allowedTokensIndex < allowedTokens.length;
            allowedTokensIndex++
        ) {
            if (allowedTokens[allowedTokensIndex] == _token) {
                return true;
            }
        }
        return false;
    }

    function addAllowedTokens(address _token) public onlyOwner {
        allowedTokens.push(_token);
    }

    function answer() public {
        uint256 reward = 10000000000000000;
        answersToAmout[msg.sender] += reward;
        answers.push(msg.sender);
    }

    function myRewards(address _account) public view returns (uint256) {
        return answersToAmout[_account];
    }

    function claimRewards() public payable {
        uint256 amount = answersToAmout[msg.sender];
        require(amount > 0, "No rewards found!");
        OTToken.transfer(msg.sender, amount);
        //   payable(msg.sender).transfer(amount);
        answersToAmout[msg.sender] = 0;
    }
    //answers arrary needs to be modified after claim
}
